import React, { Component } from 'react';

class producttax extends Component {
    render() {
        return (
            <div className="form-group row">
                <label className="col-2 col-form-label" style={{fontSize:'18px'}}>Intra State Tax Rate</label>
                <div className="col-10">
                    <select className="form-control" onChange={this.changeHandler} name="unit">
                        <option value="GST0 [ 0%]">GST0 [ 0%]</option>
                        <option value="GST5 [ 5%]">GST5 [ 5%]</option>
                        <option value="GST12 [ 12%]">GST12 [ 12%]</option>
                        <option value="GST18 [ 18%]">GST18 [ 18%]</option>
                        <option value="GST28 [ 28%]">GST28 [ 28%]</option>
                    </select>
                </div>
            </div>
        );
    }
}

export default producttax;
